class PileEmUp {
  String? name;
  int? rarity;
  String? type;
  String? effect;
  bool? hasRecipe;
  String? description;
  int? proficiency;
  List<Recipe>? recipe;

  PileEmUp({this.name, this.rarity, this.type, this.effect, this.hasRecipe, this.description, this.proficiency, this.recipe});

  PileEmUp.fromJson(Map<String, dynamic> json) {
    name = json['name'];
    rarity = json['rarity'];
    type = json['type'];
    effect = json['effect'];
    hasRecipe = json['hasRecipe'];
    description = json['description'];
    proficiency = json['proficiency'];
    if (json['recipe'] != null) {
      recipe = <Recipe>[];
      json['recipe'].forEach((v) {
        recipe!.add(new Recipe.fromJson(v));
      });
    }
  }

  Map<String, dynamic> toJson() {
    final Map<String, dynamic> data = new Map<String, dynamic>();
    data['name'] = this.name;
    data['rarity'] = this.rarity;
    data['type'] = this.type;
    data['effect'] = this.effect;
    data['hasRecipe'] = this.hasRecipe;
    data['description'] = this.description;
    data['proficiency'] = this.proficiency;
    if (this.recipe != null) {
      data['recipe'] = this.recipe!.map((v) => v.toJson()).toList();
    }
    return data;
  }
}

